def count_common_divisors(a: int, b: int) -> int:

    def gcd(x, y):
        while y:
            (x, y) = (y, x % y)
        return x
    gcd_value = gcd(a, b)
    count = 1
    for i in range(1, int(gcd_value ** 0.5) + 1):
        if gcd_value % i == 0:
            count += 1
            if i != gcd_value // i:
                count += 1
    return count

